import React from 'react'
import './user/user.css'
const user = ({ user }) => {
  return (
    <div>
      <p className="bovanh">{`Full Name: ${user.name.title} ${user.name.first} ${user.name.last}`}</p>
      <p>{`Username: ${user.login.username}`}</p>
      <img src={user.picture.thumbnail} alt=""></img>

    </div>
  )
}

export default user
